import React from "react";
import twbb from "../images/there-will-be-blood.jpg"
import { useNavigate } from "react-router-dom";

export default function Card({ props }) {
    const navigate = useNavigate();

    const navigateToMovie = () => {
        // üëáÔ∏è navigate to /contacts
        navigate('/there-will-be-blood');
    };


    try {
        const imgsource = "https://image.tmdb.org/t/p/original" + props.posterPath
        console.log(typeof (props))
        // console.log(imgsource)
        return (
            <div className="card" onClick={navigateToMovie}>
                <img src={"https://image.tmdb.org/t/p/original/neMZH82Stu91d3iqvLdNQfqPPyl.jpg"} alt="there will be blood" className="poster" />
                <div className="movie--title">Dummy</div>
                <div className="movie--director">
                    Thriller
                </div>
            </div>
        );
    } catch (e) {
        console.log(e)
    }

}
